func testQuotaDefinitionToManyAddOpOrganizations(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a QuotaDefinition
	var b, c, d, e Organization

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, quotaDefinitionDBTypes, false, strmangle.SetComplement(quotaDefinitionPrimaryKeyColumns, quotaDefinitionColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*Organization{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, organizationDBTypes, false, strmangle.SetComplement(organizationPrimaryKeyColumns, organizationColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	foreignersSplitByInsertion := [][]*Organization{
		{&b, &c},
		{&d, &e},
	}

	for i, x := range foreignersSplitByInsertion {
		err = a.AddOrganizations(ctx, tx, i != 0, x...)
		if err != nil {
			t.Fatal(err)
		}

		first := x[0]
		second := x[1]

		if a.ID != first.QuotaDefinitionID {
			t.Error("foreign key was wrong value", a.ID, first.QuotaDefinitionID)
		}
		if a.ID != second.QuotaDefinitionID {
			t.Error("foreign key was wrong value", a.ID, second.QuotaDefinitionID)
		}

		if first.R.QuotaDefinition != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}
		if second.R.QuotaDefinition != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}

		if a.R.Organizations[i*2] != first {
			t.Error("relationship struct slice not set to correct value")
		}
		if a.R.Organizations[i*2+1] != second {
			t.Error("relationship struct slice not set to correct value")
		}

		count, err := a.Organizations().Count(ctx, tx)
		if err != nil {
			t.Fatal(err)
		}
		if want := int64((i + 1) * 2); count != want {
			t.Error("want", want, "got", count)
		}
	}
}

